Within Temptation is a Dutch Gothic rock]] band founded in 1996 by vocalist Sharon den Adel and guitarist Robert Westerholt. Their music is described as symphonic metal, although their earlier material, such as Enter, was gothic metal. In an interview, Den Adel said they fell into a symphonic rock genre with various influences. In a later interview with 3VOOR12, Sharon stated that &quot;we consider ourselves more a symphonic rock band ... we are in my opinion no gothic band&quot;.

